import React, { useState } from 'react';
import { registerApi } from '../apis/Api';
import { toast } from 'react-toastify';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const Register = () => {
  const [firstName, setfirstName] = useState('');
  const [lastName, setlastName] = useState('');
  const [phoneNo, setphoneNo] = useState('');
  const [password, setPassword] = useState('');

  const changefirstName = (e) => {
    setfirstName(e.target.value);
  };
  const changelastName = (e) => {
    setlastName(e.target.value);
  };
  const changePhoneNo = (e) => {
    setphoneNo(e.target.value);
  };
  const changePassword = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    console.log(firstName, lastName, phoneNo, password);

    const data = {
      firstName: firstName,
      lastName: lastName,
      phoneNo: phoneNo,
      password: password,
    };
    registerApi(data)
      .then((res) => {
        if (res.data.success === true) {
          toast.success(res.data.message);
        } else {
          toast.error(res.data.message);
        }
      })
      .catch((err) => {
        console.log(err);
        toast.error('Internal Server Error');
      });
  };
  const defaultTheme = createTheme();

  return (
    <ThemeProvider theme={defaultTheme}>
      <Grid container component="main" sx={{ height: '100vh' }}>
        <CssBaseline />
        <Grid
          item
          xs={false}
          sm={4}
          md={7}
          sx={{
            backgroundImage: 'url(https://forstpics.forestrynepal.org/1661673205318.jpg)',
            backgroundRepeat: 'no-repeat',
            backgroundColor: 'white', // Set background color to white
            backgroundSize: '70%', // Adjust the background size
            backgroundPosition: 'center',
          }}
        />
        <Grid item xs={12} sm={8} md={5} component={Paper} elevation={6} square>
          <Box
            sx={{
              my: 8,
              mx: 4,
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
            }}
          >
            <Box
              component="form"
              noValidate
              onSubmit={handleSubmit}
              sx={{
                mt: 1,
                p: 4, // Add padding to the form
                width: '80%', // Set the width of the box
                border: '1px solid #ccc', // Add border
                borderRadius: '8px', // Add border radius
              }}
            >
              <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>
                <LockOutlinedIcon />
              </Avatar>
              <Typography component="h1" variant="h5">
                Register
              </Typography>
              <Grid container spacing={2}>
                <Grid item xs={10} sm={5}>
                  <TextField
                    margin='normal'
                    name="firstName"
                    required
                    fullWidth
                    label="First Name"
                    onChange={changefirstName}
                  />
                </Grid>
                <Grid item xs={10} sm={5}>
                  <TextField
                    name="lastName"
                    margin='normal'
                    required
                    fullWidth
                    label="Last Name"
                    onChange={changelastName}
                  />
                </Grid>
                <Grid item xs={10}>
                  <TextField
                    name="phoneNumber"
                    required
                    fullWidth
                    label="Phone number"
                    onChange={changePhoneNo}
                  />
                </Grid>
                <Grid item xs={10}>
                  <TextField
                    name="password"
                    required
                    fullWidth
                    label="Password"
                    onChange={changePassword}
                  />
                </Grid>
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  sx={{
                    mt: 2,
                    mb: 2,
                    mx: 'auto',
                    width: '50%',
                    fontSize: 'medium',
                    color: 'black', // Text color
                    backgroundColor: 'grey', // Button color
                    '&:hover': {
                      backgroundColor: 'light-blue', // Button color on hover
                    },
                  }}
                >
                  Sign In
                </Button>
                <Grid container justifyContent="center">
                  <Grid item xs={12} sx={{ textAlign: 'center', mt: 0.5, mb: 2 }}>
                    <span>
                      Already have an account?{' '}
                      <Link href="#" variant="body2" sx={{ textDecoration: 'underline' }}>
                        Log In
                      </Link>
                    </span>
                  </Grid>
                </Grid>
              </Grid>
            </Box>
          </Box>
        </Grid>
      </Grid>
    </ThemeProvider>
  );
};

export default Register;
